import React from 'react';import logo from './logo.svg';
import './App.css';

import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import Navbar from './Components/layout/Navbar';
import Home from './Components/layout/Home';
import About from './Components/layout/About';
import Employee from './Components/employees/Employee';
import Stocks from './Components/Stocks/Stocks';

import UserRegister from './Components/User/UserRegister';
import EmployeeDetails from './Components/employees/EmployeeDetails';
import StockDetails from './Components/Stocks/StocksDetails';
import LogIn from './Components/User/LogIn';




interface IProps{

}
interface IState{

}
class App extends React.Component<IProps,IState>
{
  constructor(props:IProps)
  {
    super(props)
  }

render()
{
  return (
        <React.Fragment>   
          <Router>


             <Navbar/>
             <Switch>
              <Route exact path='/' component={Home}/>
              <Route exact path='/about' component={About}/>
              <Route exact path='/employees/list' component={Employee}/>
              <Route exact path='/employees/:employeeId' component={EmployeeDetails}/>
              <Route exact path='/Stock/list' component={Stocks}/>
              <Route exact path='/stocks/:stocksId' component={StockDetails}/>

              <Route exact path='/user/Register' component={UserRegister}/>
              <Route exact path='/user/LogIn' component={LogIn}/>

            </Switch>
          </Router>

        </React.Fragment>
  );
}

}
export default App;
